import './Post.css';
import detailsIcon from '../../assets/details.png';

const dataLocation = process.env.PUBLIC_URL + "/data";

function Post() {
    return(
        <div className="Post">
            <div className="Post-header-wrapper">

                    <img 
                        className="Post-header-profile-pic" 
                        src={ dataLocation + "/1/profile.jpg" }
                    />
                    <div className="Post-header-profile-name">
                        jamesclear
                    </div>
                    <img 
                        className="Post-header-details"
                        src={detailsIcon} 
                    />

            </div>

            <img 
                className="Post-image"
                src={ dataLocation + "/1/image.jpg" } 
            />
            <div className="Post-actions-wrapper">
                <img 
                    className="Post-actions-like"
                    src={detailsIcon} 
                />
                <img 
                    className="Post-actions-comment"
                    src={detailsIcon} 
                />
                <img 
                    className="Post-actions-forward"
                    src={detailsIcon} 
                />
                <img 
                    className="Post-actions-save"
                    src={detailsIcon} 
                />
            </div>
        </div>
    );
}

export default Post;
